import courseraLogo from '../assets/png/coursera.png'

export const achievementData = {
    bio : "",
    achievements : [
        {
            id : 1,
            title : 'Deep Learning Specialization',
            details : 'The Deep Learning Specialization provides a pathway for you to take the definitive step in the world of AI by helping you gain the knowledge and skills to level up your career.',
            date : 'December, 2020',
            field : 'Deep Learning',
            image : courseraLogo
        },
        {
            id : 2,
            title : 'Natural Language Processing Specialization',
            details : 'Specialization in which you learn to design NLP applications that perform question-answering and sentiment analysis, create tools to translate languages and summarize text, and even build chatbots.',
            date : 'February, 2021',
            field : 'NLP',
            image: courseraLogo
        },
        {
            id: 3,
            title: 'Machine Learning Engineering for Production (MLOps)',
            details: 'Specialization covers how to conceptualize, build, and maintain integrated systems that continuously operate in production',
            date: 'In course',
            field: 'MLOps',
            image: courseraLogo

        }

    ]
}


